import React from 'react';
import RegisterForm from '../components/auth/RegisterForm';

const RegisterPage = () => {
  return (
    <div>
      <h1 className="text-2xl font-bold text-center mb-4">Register</h1>
      <RegisterForm />
    </div>
  );
};

export default RegisterPage;
